import React, { useState } from "react";

const DataTable = ({ accvalues, setSelected }) => {
  const [searchTerm, setSearchTerm] = useState("");
  const [currentPage, setCurrentPage] = useState(1);
  const rowsPerPage = 5;

  // Filter accvalues based on the search term
  const filteredData = accvalues.filter((row) => {
    const { username, email, date, status } = row;
    const dateMonthYear = new Date(date).toLocaleString("default", {
      month: "long",
      year: "numeric",
    });

    return (
      username.toLowerCase().includes(searchTerm.toLowerCase()) ||
      email.toLowerCase().includes(searchTerm.toLowerCase()) ||
      dateMonthYear.toLowerCase().includes(searchTerm.toLowerCase()) ||
      status.toLowerCase().includes(searchTerm.toLowerCase())
    );
  });

  const totalPages = Math.ceil(filteredData.length / rowsPerPage);

  return (
    <div className="bg-transparent font-sans leading-normal tracking-normal flex flex-col items-center">
      <div className="w-full max-w-4xl">
        <h1 className="text-2xl font-bold mb-2 text-center"></h1>

        <div className="shadow-lg rounded-lg overflow-x-auto">
          <table className="min-w-full">
            <thead>
              <tr className="bg-gray-200 uppercase text-sm leading-normal">
                <th className="py-3 px-4 text-left">Action</th>
                <th className="py-3 px-4 text-left">Username</th>
                <th className="py-3 px-4 text-left">Email</th>
                <th className="py-3 px-4 text-left">Date Created</th>
                <th className="py-3 px-4 text-left">Status</th>
              </tr>
            </thead>
            <tbody className="text-black text-sm font-light">
              {filteredData
                .slice((currentPage - 1) * rowsPerPage, currentPage * rowsPerPage)
                .map((row) => (
                  <tr
                    key={row.id}
                    className="border-b border-gray-200 hover:bg-gray-100 transition-all duration-300"
                  >
                    <td className="py-3 px-4 text-left">
                      <button
                        onClick={() => setSelected("AdminAccount", row)}
                        className="text-blue-500 hover:underline"
                      >
                        <i className="fa-solid fa-pencil"></i>
                      </button>
                    </td>
                    <td className="py-3 px-4">{row.username}</td>
                    <td className="py-3 px-4">{row.email}</td>
                    <td className="py-3 px-4">{row.date}</td>
                    <td className="py-3 px-4">
                      {row.status === "Active" ? (
                        <span className="bg-green-200 text-black py-1 px-3 rounded-full text-xs">
                          Active
                        </span>
                      ) : (
                        <span className="bg-gray-200 text-black py-1 px-3 rounded-full text-xs">
                          Disabled
                        </span>
                      )}
                    </td>
                  </tr>
                ))}
            </tbody>
          </table>
        </div>

        {/* Pagination */}
        <div className="flex justify-between items-center mt-4 mb-2">
          <button
            onClick={() => setCurrentPage(currentPage - 1)}
            disabled={currentPage === 1}
            className={`text-blue-500 px-4 py-2 ${currentPage === 1 && "opacity-50 cursor-not-allowed"}`}
          >
            Previous
          </button>

          <div className="text-black">
            Page {currentPage} of {totalPages}
          </div>

          <button
            onClick={() => setCurrentPage(currentPage + 1)}
            disabled={currentPage === totalPages}
            className={`text-blue-500 px-4 py-2 ${currentPage === totalPages && "opacity-50 cursor-not-allowed"}`}
          >
            Next
          </button>
        </div>
      </div>
    </div>
  );
};

export default DataTable;
